import React from "react";

function Weather() {
  return (
    <div className="container">
      <div className="cards">
        <h1>London</h1>
      </div>
      <h5 className="py-4">
        <i className="wi wi-day-sunny display-1"></i>
      </h5>
      <h1 className="py-2">25&deg;</h1>
    </div>
  );
}
export default Weather;
